<!DOCTYPE html>
<html lang="es">
<head>
    <link rel="icon" href="icono.ico" type="image/x-icon">
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="estilos.css">
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-QWTKZyjpPEjISv5WaRU9OFeRpok6YctnYmDr5pNlyT2bRjXh0JMhjY6hW+ALEwIH" crossorigin="anonymous">
    <title>Ingreso y Registro de Pacientes - Clínica</title>
    <style>
        .hidden {
            display: none;
        }
        body {
            font-family: Arial, sans-serif;
            background-color: #f4f4f4;
            display: flex;
            justify-content: center;
            align-items: center;
            height: center;
            margin: 0;
        }

        .container {
            background-color: #003b7e;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0px 4px 10px rgba(0, 0, 0, 0.1);
            width: 600px;
        }

        h1 {
            text-align: center;
        }

        table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 20px;
        }


        th {
            background-color: #0099ff;
            color: white;
        }

        button {
            margin: 10px 0;
            padding: 10px 20px;
            background-color: #0099ff;
            color: white;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }

        button:hover {
            background-color: #007acc;
        }
    </style>
    </head>
<body>

    <div class="card mt-2" id="inicioSection">
        <div class="card-header">
            <h1>HOSPITAL DAYEN</h1>
            <div class="btn-group">

                    <button type="button" class="btn btn-primary btn-lg" id="btnLogin">Iniciar Sesión</button>
                </a>
                    <button type="button" class="btn btn-primary btn-lg" id="btnRegister">Registrarse</button>
                </a>
            </div>
        </div>
    </div>


    <!-- Formulario de Registro -->
    <div class="container hidden" id="registerSection">
        <h1>Registro de Pacientes</h1>
        <form id="registroPaciente">
            <div class="form-group">
                <label for="nombre">Nombre:</label>
                <input type="text" id="nombre" required>
            </div>

            <div class="form-group">
                <label for="apellido">Apellido:</label>
                <input type="text" id="apellido" required>
            </div>

            <div class="form-group">
                <label for="tipoIdentificacion">Tipo de Identificación:</label>
                <select id="tipoIdentificacion">
                    <option value="CC">Cédula de Ciudadanía (CC)</option>
                    <option value="TI">Tarjeta de Identidad (TI)</option>
                    <option value="CE">Cédula de Extranjería (CE)</option>
                </select>
            </div>

            <div class="form-group">
                <label for="cedula">Numero de documento:</label>
                <input type="number" id="cedula" required>
            </div>

            <div class="form-group">
                <label for="fechaNacimiento">Fecha de Nacimiento:</label>
                <input type="date" id="fechaNacimiento" required>
            </div>

            <div class="form-group">
                <label for="genero">Género:</label>
                <select id="genero">
                    <option value="Masculino">Masculino</option>
                    <option value="Femenino">Femenino</option>
                    <option value="Otro">Otro</option>
                </select>
            </div>

            <div class="form-group">
                <label for="tipoRH">Tipo de RH:</label>
                <select id="tipoRH">
                    <option value="A+">A+</option>
                    <option value="A-">A-</option>
                    <option value="B+">B+</option>
                    <option value="B-">B-</option>
                    <option value="O+">O+</option>
                    <option value="O-">O-</option>
                    <option value="AB+">AB+</option>
                    <option value="AB-">AB-</option>
                </select>
            </div>

            <div class="form-group">
                <label for="estadoCivil">Estado Civil:</label>
                <select id="estadoCivil">
                    <option value="Soltero">Soltero</option>
                    <option value="Casado">Casado</option>
                    <option value="Divorciado">Divorciado</option>
                    <option value="Viudo">Viudo</option>
                </select>
            </div>

            <div class="form-group">
                <label for="patologias">Patologías:</label>
                <textarea id="patologias" rows="3"></textarea>
            </div>
            <div class="btn-group"  >    
                <button type="submit" class="btn btn-primary btn-lg"  >Registrar</button>
            </div>
            <!-- Botón para cancelar y volver -->
            <div class="btn-group">
            <button type="button" id="btnCancelar" class="btn btn-primary btn-lg" onclick="volverAInicio2()">Cancelar y volver</button>
            </div>
        </form>
    </div>

        <!-- Formulario de Login -->
        
    <div class="container hidden" id="loginSection"style="display: align-items: center height: 100vh align-items: center ;">
        <div class="card-header d-flex " >
            <a href="index.html" class="btn btn-primary" id="btnCancelar">Volver</a>
        </div>
        <img src="logo.png" alt="" width="400" height="400" style="margin-right: 10px; border-radius: 30px;" ><h1>Ingreso Paciente con documento</h1>
        <form id="loginPaciente">
            <div class="form-group">
                <label for="cedulaLogin"></label>
                <input type="number" id="cedulaLogin" required>
            </div>

            <button type="submit" class="btn btn-primary">Ingresar</button>
        </form>
    </div>

    <!-- Pantalla de Bienvenida -->
    <div class="container hidden" id="welcomeSection" >
        <img src="logo.png" alt="" width="250" height="250" style="margin-right: 10px; border-radius:30px; "><h1 id="welcome">Bienvenido a hospital DAYJEN</h1>
        <h2 id="pacienteInfo"></h2>
        <div class="actions">
            <button id="btnModificar" class="btn btn-primary">Modificar Información</button>
            <a class="btn btn-primary" href="calendarario.html" role="button" style="text-decoration: none;">Citas Médicas</a>
            <button id="btnEliminar" class="btn btn-primary">Eliminar Usuario</button>
            <button id="btnCerrarSesion" class="btn btn-primary">Cerrar Sesión</button>
        </div>
        
        <div class="container">
            <h1>Citas Guardadas</h1>
            <table id="tabla-citas">
                <thead>
                    <tr>
                        <th>Fecha</th>
                        <th>Hora</th>
                        <th>Especialidad</th>
                        <th>Acción</th>
                    </tr>
                </thead>
                <tbody></tbody>
            </table>
            <button onclick="location.href='calendarario.html';">Volver a Agendar Citas</button>
        </div>
    
    <!-- Modal de Confirmación para Eliminar Usuario -->
    <div id="confirmacionModal" class="container hidden">
        <h1>Confirmar Eliminación</h1>
        <p>¿Estás seguro de que quieres eliminar este usuario?</p>
        <button id="confirmarEliminar" class="btn btn-primary">Sí, eliminar</button>
        <button id="cancelarEliminar" class="btn btn-primary">Cancelar</button>
    </div>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/2.5.1/jspdf.umd.min.js"></script>
    <script>
        // Obtener elementos del DOM
        const btnLogin = document.getElementById('btnLogin');
        const btnRegister = document.getElementById('btnRegister');
        const inicioSection = document.getElementById('inicioSection');
        const registerSection = document.getElementById('registerSection');
        const loginSection = document.getElementById('loginSection');
        const welcomeSection = document.getElementById('welcomeSection');
        const welcomeText = document.getElementById('welcome');
        const pacienteInfo = document.getElementById('pacienteInfo');

        const registroPaciente = document.getElementById('registroPaciente');
        const loginPaciente = document.getElementById('loginPaciente');

        const btnModificar = document.getElementById('btnModificar');
        const btnCitas = document.getElementById('btnCitas');
        const btnEliminar = document.getElementById('btnEliminar');
        const btnCerrarSesion = document.getElementById('btnCerrarSesion');
        const confirmacionModal = document.getElementById('confirmacionModal');
        const confirmarEliminar = document.getElementById('confirmarEliminar');
        const cancelarEliminar = document.getElementById('cancelarEliminar');

        // Almacenar pacientes en LocalStorage
        let pacientes = JSON.parse(localStorage.getItem('pacientes')) || [];
        let pacienteActual = null;

        // Mostrar el formulario de registro al hacer clic en "Registrarse"
        btnRegister.addEventListener('click', () => {
            inicioSection.classList.add('hidden');
            registerSection.classList.remove('hidden');
        });

        // Mostrar el formulario de login al hacer clic en "Iniciar Sesión"
        btnLogin.addEventListener('click', () => {
            inicioSection.classList.add('hidden');
            loginSection.classList.remove('hidden');
        });

        // Evento de registro de pacientes
        registroPaciente.addEventListener('submit', function(event) {
            event.preventDefault();

            const nuevoPaciente = {
                nombre: document.getElementById('nombre').value,
                apellido: document.getElementById('apellido').value,
                tipoIdentificacion: document.getElementById('tipoIdentificacion').value,
                cedula: document.getElementById('cedula').value,
                fechaNacimiento: document.getElementById('fechaNacimiento').value,
                genero: document.getElementById('genero').value,
                tipoRH: document.getElementById('tipoRH').value,
                estadoCivil: document.getElementById('estadoCivil').value,
                patologias: document.getElementById('patologias').value
            };

            pacientes.push(nuevoPaciente);
            localStorage.setItem('pacientes', JSON.stringify(pacientes));

            registroPaciente.reset();

            // Mostrar pantalla de login
            registerSection.classList.add('hidden');
            loginSection.classList.remove('hidden');
        });

        // Evento de ingreso de pacientes
        loginPaciente.addEventListener('submit', function(event) {
            event.preventDefault();

            const cedulaLogin = document.getElementById('cedulaLogin').value;

            pacienteActual = pacientes.find(paciente => paciente.cedula === cedulaLogin);

            if (pacienteActual) {
                alert(`¡Bienvenid@, ${pacienteActual.nombre}! Has iniciado sesión correctamente.`);
                welcomeText.innerHTML = `<p><strong>Bienvenido:${pacienteActual.nombre} ${pacienteActual.apellido}</p>`;
                pacienteInfo.innerHTML = `
                <p><strong>Tipo de Identificación:</strong> ${pacienteActual.tipoIdentificacion}</p>
                <p><strong>Fecha Nacimiento:</strong> ${pacienteActual.fechaNacimiento}</p>
                <p><strong>Genero:</strong> ${pacienteActual.genero}</p>
                <p><strong>Tipo de sangre (RH):</strong> ${pacienteActual.tipoRH}</p>
                <p><strong>Estado Civil:</strong> ${pacienteActual.estadoCivil}</p>`;
                loginSection.classList.add('hidden');
                welcomeSection.classList.remove('hidden');
            } else {
                alert('Paciente no encontrado. Por favor regístrate.');
            }
        });

        // Función para volver a la pantalla de inicio
        function volverAInicio() {
            loginSection.classList.add('hidden');
            inicioSection.classList.remove('hidden');
        }

        // Función para volver a la pantalla de inicio
        function volverAInicio2() {
            registerSection.classList.add('hidden');
            inicioSection.classList.remove('hidden');
        }

        // Modificar información
        btnModificar.addEventListener('click', () => {
            // Rellenar el formulario de registro con los datos del paciente actual
            document.getElementById('nombre').value = pacienteActual.nombre;
            document.getElementById('apellido').value = pacienteActual.apellido;
            document.getElementById('tipoIdentificacion').value = pacienteActual.tipoIdentificacion;
            document.getElementById('cedula').value = pacienteActual.cedula;
            document.getElementById('fechaNacimiento').value = pacienteActual.fechaNacimiento;
            document.getElementById('genero').value = pacienteActual.genero;
            document.getElementById('tipoRH').value = pacienteActual.tipoRH;
            document.getElementById('estadoCivil').value = pacienteActual.estadoCivil;
            document.getElementById('patologias').value = pacienteActual.patologias;

            // Mostrar el formulario de registro con los datos para modificar
            welcomeSection.classList.add('hidden');
            registerSection.classList.remove('hidden');

            // Actualizar la información del paciente al enviar de nuevo el formulario
            registroPaciente.addEventListener('submit', function(event) {
                event.preventDefault();

                pacienteActual.nombre = document.getElementById('nombre').value;
                pacienteActual.apellido = document.getElementById('apellido').value;
                pacienteActual.tipoIdentificacion = document.getElementById('tipoIdentificacion').value;
                pacienteActual.cedula = document.getElementById('cedula').value;
                pacienteActual.fechaNacimiento = document.getElementById('fechaNacimiento').value;
                pacienteActual.genero = document.getElementById('genero').value;
                pacienteActual.tipoRH = document.getElementById('tipoRH').value;
                pacienteActual.estadoCivil = document.getElementById('estadoCivil').value;
                pacienteActual.patologias = document.getElementById('patologias').value;

                localStorage.setItem('pacientes', JSON.stringify(pacientes));

                alert('Información modificada correctamente.');
                registerSection.classList.add('hidden');
            });
        });


        // Eliminar usuario
        btnEliminar.addEventListener('click', () => {
            confirmacionModal.classList.remove('hidden');
        });

        // Confirmar eliminación
        confirmarEliminar.addEventListener('click', () => {
            pacientes = pacientes.filter(paciente => paciente !== pacienteActual);
            localStorage.setItem('pacientes', JSON.stringify(pacientes));
            alert('Usuario eliminado con éxito.');
            confirmacionModal.classList.add('hidden');
            welcomeSection.classList.add('hidden');
            inicioSection.classList.remove('hidden');
        });

        // Cancelar eliminación
        cancelarEliminar.addEventListener('click', () => {
            confirmacionModal.classList.add('hidden');
        });

        // Cerrar sesión
        btnCerrarSesion.addEventListener('click', () => {
            welcomeSection.classList.add('hidden');
            inicioSection.classList.remove('hidden');
        });

        document.addEventListener("DOMContentLoaded", function() {
            const tablaCitas = document.getElementById("tabla-citas").getElementsByTagName("tbody")[0];

            // Función para cargar citas guardadas desde el localStorage
            function cargarCitas() {
                let citas = JSON.parse(localStorage.getItem("citas")) || [];

                // Limpiar la tabla antes de llenarla
                tablaCitas.innerHTML = "";

                // Iterar sobre las citas guardadas y agregarlas a la tabla
                citas.forEach((cita, index) => {
                    let fila = tablaCitas.insertRow();
                    fila.insertCell(0).innerText = cita.fecha;
                    fila.insertCell(1).innerText = cita.hora;
                    fila.insertCell(2).innerText = cita.especialidad;

                    let celdaAccion = fila.insertCell(3);
                    let btnDescargar = document.createElement("button");
                    btnDescargar.innerText = "Descargar PDF";
                    btnDescargar.addEventListener("click", function() {
                        descargarCitaPDF(cita);
                    });
                    celdaAccion.appendChild(btnDescargar);
                });
            }

            function descargarCitaPDF(cita) {
